import React from 'react';
import GitHubIcon from '@material-ui/icons/GitHub';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import '../Styles/Social.css'
function Social()
{
        return (
           <footer className="footer_">
           
               <ul>
                   <li>  <GitHubIcon/>
    </li>
    <li><LinkedInIcon/></li>
               </ul>
          
            
               </footer>
            );
        
    }
    
export default Social;
